import Footer from './PixelVenturesContainer/Footer/Footer';

export default function App() {
  return (
    <div className="app">
        <Nav/>
        <Header/>
        <Tech/>
        <Portfolio/>
        <About/>
        <Contact/>
        <Footer/>
    </div>
  );
}
